import StarRatings from 'react-star-ratings';

const Card = ({ expert }) => {
    return <div className="max-w-sm rounded overflow-hidden shadow-lg flex flex-col w-11/12">
        <img className="w-full expert-img" src={ expert.img } alt={ expert.name } />
        <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2">{ expert.name }</div>
            <p className="text-gray-700 text-base line-clamp-3">
                { expert.desc }
            </p>
        </div>
        <div className="px-6 pt-4 pb-2 mt-auto">
            <StarRatings
                rating={ expert.rating }
                starRatedColor="gold"
                svgIconPath="M11.049 2.927c.3-.921 1.603-.921 1.902 0l1.519 4.674a1 1 0 00.95.69h4.915c.969 0 1.371 1.24.588 1.81l-3.976 2.888a1 1 0 00-.363 1.118l1.518 4.674c.3.922-.755 1.688-1.538 1.118l-3.976-2.888a1 1 0 00-1.176 0l-3.976 2.888c-.783.57-1.838-.197-1.538-1.118l1.518-4.674a1 1 0 00-.363-1.118l-3.976-2.888c-.784-.57-.38-1.81.588-1.81h4.914a1 1 0 00.951-.69l1.519-4.674z"
                svgIconViewBox="0 0 24 24"
                numberOfStars={5}
                starDimension="20px"
                starSpacing="2px"
                name='rating'
            />
        </div>
    </div>
};

export default Card;
